column4:
@Thomas看看世界
参加了托神修图比赛，简单说说思路，首先是因为手机看图时代的到来，我决定选择竖构图的那一张进行后期，再仔细观察过后，我发现了小屋与雪山这两个兴趣点，自然与人文、宏大与渺小融合的恰到好处（同时，为了适应手机全面屏，我决定将照片裁成9比18的尺寸并将最主要的小屋雨雪山两个兴趣点包含在内）接下来就是有些魔幻感的暗调风格化调色与光影重塑，以突出山于屋（人）的强烈对比。
大概做的工作就是以上这...

